import React from 'react';
import './RegisterInput.css';

function RegisterInput({label, name, placeholder}) {
    return(
        <div className="register-input">
            <label className="register-input__label">{label}</label>
            <input type="text" name={name} className="register-input__input" minLength="2" maxLength="30" placeholder={placeholder} required />
        </div>
    )
}

export default RegisterInput;
